'use strict';

/**
* Computes the arccosecant of a number.
*
* @param x - input value
* @returns hyperbolic arccosecant (in radians)
*
* @example
* var v = acsch( 2.0 );
* // returns ~0.48
*
* @example
* var v = acsch( 5.0 );
* // returns ~0.2
*
* @example
* var v = acsch( -23.0 );
* // returns ~-0.04
*
* @example
* var v = acsch( NaN );
* // returns NaN
*/

// MODULES //

var acsch = require( './acsch.js' );


// EXPORTS //

module.exports = acsch;
